import React from 'react';
import { faSignOutAlt } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

function NavbarComponent() {
    return (
        <div className="flex flex-row w-full h-16 fixed bg-gray-800 px-9 m">
            <div className="flex w-20 h-16 justify-center items-center">
                <h1 className="text-lg font-bold text-white">My App</h1>
            </div>
            <div className='flex w-20 h-16 justify-center items-center ml-auto'>
                <FontAwesomeIcon icon={faSignOutAlt} color='white' size="lg" />
            </div>
        </div>
    );
}

export default NavbarComponent;
